          "id": "2efcd90ff72f4ffe8637f118ad2844d9e44bf789",
          "message": "Extended server benchmark model list (#40)\n\nThis PR updates the benchmark configs to include some a large model that\r\nrun on the 4x H100 runner.\r\n\r\nTo accomplish this, the various `benchmark_` inputs to `build-test` are\r\nconsolidated into the JSON-based `benchmark_configs` input (which\r\naccepts a list of objects containing keys: `label`, `config_file`,\r\n`timeout`).\r\n\r\nThis allows the existing benchmarking of small models to continue\r\nrunning on the runners they already are, while allowing a new config\r\nwith large models to run specifically on the 4x H100 machine.\r\n\r\nAdditionally, the config now supports an optionally-present property to\r\ndefine the server startup timeout, which is set on the large model\r\nconfig (60 min). This will override the default (15 min) if present. In\r\nthe course of adding this support, I fixed a handful of incorrect type\r\nhinting about the config object (as it tripped me up when I tried to use\r\nit as the advertised type, which didnt work).",
